import React, { useEffect, useState } from 'react';
import {
  Button,
  Window,
  WindowContent,
  WindowHeader,
  ScrollView,
  TextInput
} from 'react95';


export default ({setShowAOL}) => {

  return (
    <>
      <Window style={{width: '360px'}} resizable className='window'>
        <WindowHeader style={{
          display: 'flex',
          justifyContent: 'space-between'
        }}>
          <span>You've got mail!</span>
          <Button style={{marginTop: '2px'}} onClick={()=>{
            setShowAOL(false)}}>
            <b>x</b>
          </Button>
        </WindowHeader>
        <WindowContent>
          <table>
            <tr>
              <td>To:</td><td>Chamille Winters</td>
            </tr>
            <tr>
              <td>Subject:</td><td>Hey lil bro!</td>
            </tr>
          </table>
          From: Camille Winters<br />
          Subject: <TextInput defaultValue='Disabled' fullWidth />
          <TextInput multiline rows={4} defaultValue={'hi'} fullWidth />
        </WindowContent>
      </Window>

    </>
  );
}
